}
</code></pre>
<p>Now I already have a <code>tempId</code> assigned to the doc and sometimes that field might expire and not exist inside the document. I wanted to know if I'm updating the document with a different <code>receivedAt</code> parameter or any other parameter and it does not have a tempId then only assign it a <code>tempId</code> else let the <code>tempId</code> be as it is.</p>
